'                           <p class="ibm-small initial-text">Buying with a Hybrid Flex (HDMP) subscription lets you use your monthly spend for either Db2 on Cloud or other Db2 family products, such as Db2 on premises, Db2 Warehouse and more. <strong>*Minimum spend of USD 650.00/month is required.</strong></p>' +
'                           <p class="ibm-small ibm-padding-bottom-0">Starting at*</p>' +
'                           <div class="fixed-size">' +
'                              <p class="ibm-bold ibm-padding-bottom-r1"><sup class="ibm-small">USD</sup> <span class="ibm-h1">189</span><sup class="ibm-small">.00/mo.</sup></p>' +
'                           </div>' +
'                           <div class="features">' +
'                              <p class="ibm-bold">Features</p>' +
'                              <ul class="ibm-small">' +
'                                 <li>Scalable RAM, CPU and storage</li>' +
'                                 <li>Flexible pricing</li>' +
'                                 <li>Hybrid entitlement<br/></li>' +
'                              </ul>' +
'                           </div>' +
'                           <p class="ibm-btn-row"><a class="ibm-btn-pri ibm-btn-systems-blue-6" href="https://console.bluemix.net/catalog/services/db2?cm_mc_uid=49213304557015366909441&cm_mc_sid_50200000=18661871539535255297&cm_mc_sid_52640000=42110001539536980893" target="_blank">Start now</a><a href="javascript:void(0);" class="ibm-textcolor-systems-blue-6 ibm-small ibm-toggle-link"><span class="ibm-desc-tag">Learn more</span> <span class="ibm-chevron-down-link">' +
'                              </span></a>' +
'                           </p>' +
'                           <p class="ibm-small text-toggle" style="display:none">Scale compute and storage resources dynamically, which will be metered hourly and billed against your HDMP FlexPoint entitlement. To learn more or subscribe to the Hybrid Data Management Platform, please visit: <a href="https://ibm.biz/hybrid-data-management-marketplace-page" target="_blank" class="ibm-textcolor-systems-blue-6">https://ibm.biz/hybrid-data-management-marketplace-page</a>. For existing customers, FlexPoint entitlements can be monitored and managed at: <a href="https://hybrid-cloud-usage-hub.mybluemix.net" target="_blank" class="ibm-textcolor-systems-blue-6">https://hybrid-cloud-usage-hub.mybluemix.net</a></p>' +
'                        </div>' +
'                     </div>' +
'                  </div>' +
'               </div>' +
'            </div>' +
'         </div>' +
'      </div>' +
'   </div>' +
'</section>';

