//We need to separate the names from the IDs since everything is returned in one string
function getTextBefore(str, chr) {
    if (!str) {
        return "";
    }

    var index = str.indexOf(chr);
    if (index != -1) {
        return str.substring(0, index);
    }
    return "";
}

function getDriverData() {
    try {
        projectData = window.optimizely.get("data");
        optlyState = window.optimizely.get("state");

        decisionObject = optlyState.getDecisionObject({
            "campaignId": campaignId
        });

        campaigns = optlyState.getCampaignStates({
            isActive: true
        });

        campaignName = getTextBefore(decisionObject.campaign, " (");
        experimentName = getTextBefore(decisionObject.experiment, " (");
        experimentId = decisionObject.experiment.match(/\(([^)]+)\)/)[1]; //Extract the id value
        variationName = getTextBefore(decisionObject.variation, " (");
        variationId = decisionObject.variation.match(/\(([^)]+)\)/)[1]; //Extract the id value
        audiences = campaigns[campaignId].audiences;
        audienceId = "Everyone";
        if (audiences && Array.isArray(audiences)) {
            audiences.forEach(function(arrayItem) {
                if (audienceId === "Everyone") {
                    audienceId = arrayItem.id;
                } else {
                    audienceId = arrayItem.id + ',' + audienceId;
                }
            });
        }
    } catch (err) {
        console.log(err);
    }
}

